import React, { useContext } from "react";
import { IEmployee } from "../../models/IEmployee";
import { EmployeContext } from "../context/employe.context";
import { ItemsEmployee } from "./ItemsEmploye";

export const ListEmployee = () => {
  const { employe, setEmploye } = useContext(EmployeContext);
  const handleClick = () => {
    setEmploye([
      {
        deparment: "asjdkas",
        hours_extra: 12,
        id_person: "asdas",
        salary: 122,
      },
    ]);
  };
  return (
    <React.Fragment>
      <h1>hello List</h1>
      <button onClick={handleClick}>ClickMe</button>
      {employe.map((value: IEmployee) => (
        <ItemsEmployee
          key={value.id_employee}
          hours_extra={value.hours_extra}
          deparment={value.deparment}
          salary={value.salary}
          id_person={value.id_person}
        />
      ))}
    </React.Fragment>
  );
};
